import React from "react";

function About() {
  return (
    <div id="about" className="about-content">
      
      <div className="about-text">
        <h1>Why us?</h1>
        <br/>
        
      </div>

      <div>
        <img className="about-img" src={require("../images/about-img.jpg").default} alt="logo"/>
      </div>


    </div>
  );
}

export default About;
